    (70, 'Byle do świtu!', 'Until Dawn', 'Rok po tajemniczym zniknięciu swojej siostry Melanie, Clover i jej przyjaciele udają się do odległej doliny, w której zniknęła, w poszukiwaniu odpowiedzi. Przeszukując opuszczone centrum dla zwiedzających, odkrywają, że są prześladowani przez zamaskowanego zabójcę i mordowani jeden po drugim... tylko po to, aby obudzić się i znaleźć się z powrotem na początku tego samego wieczoru.', '2025-10-23', 103, 'David F. Sandberg', 'https://fwcdn.pl/fpo/34/71/10063471/8167415.10.webp', '2025-11-20 19:21:53.201774+00', '2025-11-20 19:21:53.201792+00', false, '2025-11-18');
