    (72, 'SpongeBob: Klątwa pirata', 'The SpongeBob Movie: Search for SquarePants', 'Zdesperowany, aby zostać wielkim, SpongeBob wyrusza, aby udowodnić swoją odwagę Panu Krabsowi, podążając za Latającym Holendrem - tajemniczym piratem-duchem - podczas przygody, która zabierze go w najgłębsze głębiny morskie, gdzie żadna gąbka nie dotarła wcześniej.', '2026-01-01', 96, 'Pam Brady', 'https://image.tmdb.org/t/p/w600_and_h900_face/vTqCjkM4yGl4v77wPQdpUBmGDhr.jpg', '2025-12-15 16:46:05.712833+00', '2025-12-15 21:29:13.89906+00', true, '2026-02-02');
INSERT INTO public.movies_movie
VALUES
    (74, 'Song Sung Blue', 'Song Sung Blue', '„Nie jestem autorem piosenek, nie jestem symbolem seksu – po prostu chcę dostarczać ludziom rozrywki” – stwierdza bohater filmu Mike Sardina, grany przez Hugh Jackmana. Kate Hudson gra Claire Stengl, która nie chcę być fryzjerką. Chcę śpiewać, tańczyć, chcę uprawiać ogród i mieć kota”. Para stworzyła zespół hołdujący twórczości Neila Diamonda, udowadniając, że nigdy nie jest za późno, by odnaleźć miłość i spełnić marzenia. Tak powstaje zespół tribute Lightning & Thunder. Rozkwita romans, opowiad', '2025-12-30', 133, 'Craig Brewer', 'https://image.tmdb.org/t/p/w600_and_h900_face/rZf6KsP2svdNdXG8VpjswrnIwf0.jpg', '2025-12-15 16:53:34.933561+00', '2025-12-15 16:53:34.933573+00', false, '2026-01-25');
INSERT INTO public.movies_movie
VALUES
    (73, 'Pomoc domowa', 'The Housemaid', 'Milli ma za sobą niełatwą przeszłość, więc to czego dziś szuka, to spokojna przystań z dala od zgiełku i potencjalnych kłopotów. Chętnie więc zatrudnia się jako pomoc domowa w wielkim domu bogatego małżeństwa Winchesterów. Sprząta, gotuje, odbiera ze szkoły córkę swych pracodawców, a wolne chwile spędza samotnie w małym pokoju na poddaszu. Choć zachowania domowników zaczynają budzić jej coraz większy niepokój, stara się to ignorować. Mimo wszystko zazdrości pani Winchester jej pełnego przepychu,', '2025-12-19', 131, 'Paul Feig', 'https://image.tmdb.org/t/p/w600_and_h900_face/vVWQm8xikIKMQSwPuArsapJoYhY.jpg', '2025-12-15 16:50:16.696028+00', '2025-12-15 16:50:16.69604+00', false, '2026-02-07');
INSERT INTO public.movies_movie
VALUES
    (71, 'Avatar: Ogień i popiół', 'Avatar: Fire and Ash', 'W obliczu niszczycielskiej wojny z RDA i utraty najstarszego syna, Jake Sully i Neytiri stają w obliczu nowego zagrożenia na Pandorze: Ash People, brutalnego i żądnego władzy plemienia Na''vi dowodzonego przez bezwzględnego Varanga. Rodzina Jake''a musi walczyć o przetrwanie i przyszłość Pandory w konflikcie, który popycha ich do granic możliwości emocjonalnych i fizycznych.', '2025-12-19', 197, 'James Cameron', 'https://image.tmdb.org/t/p/w600_and_h900_face/m0UoNRK2H2TsR1EbzgngF4vlOsU.jpg', '2025-12-15 16:41:07.576464+00', '2025-12-15 16:41:07.57648+00', false, '2026-01-01');
INSERT INTO public.movies_movie
VALUES
    (79, 'Mikołaj i ekipa', 'SuperKlaus', 'Święty Mikołaj marzy o ekscytujących przygodach wykraczających daleko poza „zwyczajne” rozdawanie prezentów na latających saniach w wigilijną noc. Pewnego dnia, w wyniku nagłego uderzenia w głowę, wszystko mu się miesza i zaczyna wierzyć, że jest superbohaterem, który musi stawić czoła licznym przygodom. I tak, na cztery dni przed Bożym Narodzeniem nagle znika.', '2025-12-01', 88, 'Steve Majaury', 'https://image.tmdb.org/t/p/w600_and_h900_face/2MwEiqlRj0z6COOGNL7oqOV0DMw.jpg', '2025-12-15 17:18:01.967547+00', '2025-12-15 17:18:01.967561+00', false, '2025-12-28');
