    (75, 'Wicked: na dobre', 'Wicked: For Good', 'Glinda i Elphaba będą musiały po raz ostatni się zjednoczyć. Ich niezwykła przyjaźń stanie się osią, od której zależy ich przyszłość. By odmienić siebie i całe Oz na dobre, będą musiały obdarzyć wzajemnym zaufaniem i empatią.', '2025-11-10', 137, 'Jon M. Chu', 'https://image.tmdb.org/t/p/w600_and_h900_face/iS3KHLYRW8AMK888GvnLEnduBw7.jpg', '2025-12-15 16:56:48.836942+00', '2025-12-15 16:56:48.836957+00', false, '2025-12-29');
