    (77, 'Norymberga', 'Nuremberg', 'Jest rok 1945. Cały świat żyje rozpoczynającym się w niemieckiej Norymberdze procesem nazistowskich zbrodniarzy wojennych. Prokurator Robert H. Jackson, który jest głównym oskarżycielem z ramienia Stanów Zjednoczonych ma świadomość jak trudnego podjął się zadania. Wie, że główny oskarżony Hermann Göring jest człowiekiem nie tylko bezlitosnym, ale także błyskotliwie inteligentnym, więc uzyskanie jego obciążających zeznań to zadanie ekstremalnie trudne. Młody psychiatra Douglas Kelley otrzymuje wi', '2025-11-18', 148, 'James Vanderbilt', 'https://image.tmdb.org/t/p/w600_and_h900_face/gvDlUs4YlU9vrATXbMVbPePVjmk.jpg', '2025-12-15 17:13:03.618564+00', '2025-12-15 21:29:04.290435+00', true, '2026-02-16');
